import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #2563eb;
  color: white;
  padding: 2rem;
  text-align: center;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <p>&copy; 2024 Your Company. All rights reserved.</p>
    </FooterContainer>
  );
};

export default Footer;
